import {
    MDBTabsContent,
    MDBTabsPane,
    MDBBtn,
    MDBIcon,
    MDBInput,
    MDBCheckbox
}
    from 'mdb-react-ui-kit';
    import axios from 'axios';

function Register() {



    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData(prevState => ({
            ...prevState,
            [name]: value
        }));
    };

    const handleSubmit = async () => {
        const userData = {
            name: '',
            email: '',
            password: ''
        };

        try {
            const response = await axios.post('https://example.com/api/register', userData);

            console.log('Response from server:', response.data);
        } catch (error) {
            console.error('Error:', error);
        }
    };

    return (


        <MDBTabsContent >

            <MDBInput wrapperClass='mb-4' label='Name Surname' type='text' />
            <MDBInput wrapperClass='mb-4' label='Email' type='email' />
            <MDBInput wrapperClass='mb-4' label='Password' type='password' />
            <MDBInput wrapperClass='mb-4' label='Password Again' type='password' />

            <MDBBtn className="mb-4 w-100" onClick={handleSubmit}>Sign up</MDBBtn>

        </MDBTabsContent>


    );
}

export default Register;
